import Brand from "./NavBar/Brand/brand";
import Menu from "./NavBar/Menu/menu";
import "./Home.css";
import Card from "./Header/Card/Card";

const Home = () => {
  return (
    <div>
      <div className="container fs-3 text-white">
        <div className="mb-5">
          <Brand></Brand>
          <Menu></Menu>
        </div>
        <div>
          <Card></Card>
        </div>
      </div>
    </div>
  );
};

export default Home;
